import './App.css';
import React from "react";
import { Routes, Route, } from "react-router-dom";
import Navbar from './components/Navbar';
import Home from './components/Home';
import About from './components/About';


function App() {
  return (
    <>

        <Navbar />

        <Routes>

          <Route path="/">
            <Home />
          </Route>

          <Route exact path="/about">
            <About />
          </Route>

        </Routes>

    </>
  );
}

export default App;
